/**
 * Created by weiyun on 2019/10/24.
 */
import React,{Component} from 'react'


class Action extends Component{
    render(){
        return(
            <div>
                Action
            </div>
        )
    }
}

class List extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div>
                {this.props.data.map(item=>{<p key={item.key}>item.item</p>})}
            </div>
        )
    }
}

class App extends Component{

    constructor(props){
        super(props)
        this.state = {
            data:[
            {'key':0,'item':'a'},
            {'key':1,'item':'b'},
            {'key':2,'item':'c'},
                ]
        }
    }


    render(){
        return(
            <div>
                <Action/>
                <List data={this.state.data}/>
            </div>
        )
    }
}

export default App
